import React from 'react';
import "../Css/Design.css"
import Gallery from 'react-grid-gallery';
import Elder from '../Images/Elder.jpg';
import Peng from '../Images/Peng.png';
import Pengs from '../Images/Pengs.jpg';
import Plak from '../Images/Plak.png';
import Light from '../Images/light.png';
import Mother100 from '../Images/Mother100.jpg';
import Car from '../Images/Car.gif';

const IMAGES =
[{
  src: Peng,
  thumbnail: Peng,
  thumbnailWidth: 500,
  thumbnailHeight: 300,
  tags: [{value: "Ocean", title: "Ocean"}, {value: "People", title: "People"}],
  caption: "Boats (Jeshu John - designerspics.com)"
},
{
  src: Pengs,
  thumbnail: Pengs,
  thumbnailWidth: 300,
  thumbnailHeight: 300,
  tags: [{value: "Ocean", title: "Ocean"}, {value: "People", title: "People"}],
  caption: "Boats (Jeshu John - designerspics.com)"
},
{
  src: Light,
  thumbnail: Light,
  thumbnailWidth: 400,
  thumbnailHeight: 300,
  tags: [{value: "Ocean", title: "Ocean"}, {value: "People", title: "People"}],
  caption: "Boats (Jeshu John - designerspics.com)"
},
{
  src: Mother100,
  thumbnail: Mother100,
  thumbnailWidth: 72,
  thumbnailHeight: 72,
  tags: [{value: "Ocean", title: "Ocean"}, {value: "People", title: "People"}],
  caption: "Boats (Jeshu John - designerspics.com)"
},
{
  src: Plak,
  thumbnail: Plak,
  thumbnailWidth: 200,
  thumbnailHeight: 400,
  tags: [{value: "Ocean", title: "Ocean"}, {value: "People", title: "People"}],
  caption: "Boats (Jeshu John - designerspics.com)"
},
{
  src: Car,
  thumbnail: Car,
  thumbnailWidth: 320,
  thumbnailHeight: 212,
  tags: [{value: "Ocean", title: "Ocean"}, {value: "People", title: "People"}],
  caption: "Boats (Jeshu John - designerspics.com)"
}]

class Designs extends React.Component {
  renderLng = () => (
<div className="extra">
  <div class="gallery">
    <img src={Elder} alt="Elder"/>
  </div>
  <div class="gallery">
    <img src={Elder} alt="Elder" />

  </div>
</div>

  )
  render() {
    return (
      <div>
        <div className="gal">
        <Gallery images={IMAGES}
          enableImageSelection={false}
          margin={6}
          rowHeight={250}
        />

        </div>
      </div>
    )
  }
}
export default Designs;
